import React from 'react';
import { useNavigate } from 'react-router-dom';
import BookList from './BookList';  // Import BookList

const Home = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate("/"); // Redirect to the first page (login or home)
  };

  return (
    <div>
      <nav className="navbar">
        <div className="navbar-left">
          <button className="navbar-button">Cart</button>
          <button onClick={handleLogout} className="navbar-button">Logout</button>
        </div>
        <div className="navbar-right">
          <span className="navbar-brand">Litverse</span>
        </div>
      </nav>

      <div className="home-content">
        <h1>Welcome to Your Dashboard!</h1>
        <p>This is your home page after logging in.</p>
        
        {/* Display the list of books */}
        <BookList /> {/* BookList component will fetch and display books */}
      </div>
    </div>
  );
};

export default Home;
